import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#46387C',
      alignItems: 'center',
      justifyContent: 'center',
    },
    button: {
      backgroundColor: '#00D8FF',
      width: 156,
      height: 45,
      justifyContent: 'center',
      alignItems: 'center',
      borderRadius: 5
    },
    buttonText: { color: '#302850', fontSize: 16 },
    item: {
      flex: 1
    }
});


  
export default styles;
